import logo from './logo.svg';
import './App.css';
import Header from './component/Header'
import Footer from './component/Footer'
import Cart from './component/Cart'
import AOS from 'aos';
import 'aos/dist/aos.css';
function App() { 
  AOS.init();
  return (
    <div className="App">
      <Header></Header>
      <div className="body">
        <Cart data-aos="fade-up"
    data-aos-offset="200"
    data-aos-delay="50"
    data-aos-duration="1000"
    data-aos-easing="ease-in-out"
    data-aos-mirror="true"
    data-aos-once="false"
    data-aos-anchor-placement="top-center"></Cart>
        <Cart></Cart>
        <Cart></Cart>
        <Cart></Cart>
        <Cart></Cart>
      </div>
      <Footer></Footer>
    </div>
  );
}

export default App;
